import React from 'react';
import Home from './Home';
import Service from './Service';
import Contact from './Contact';
import Footer from './Footer';
import './App.css';
import {NavLink} from 'react-router-dom'
import{BrowerR as Router,Switch,Redirect} from 'react-router-dom';
const App=props=>{

  return(
   <>
<body>

<div>

<Router>
<NavLink className='a2' to='/' style={{textDecoration:'none',marginLeft:'300px'}}>Home</NavLink>
<NavLink className='a3' to='/Service' style={{textDecoration:'none'}}>Service</NavLink>
<NavLink className='a4' to='/Contact' style={{textDecoration:'none'}}>Contact</NavLink>
<br></br>

<Switch>
<Route exact path="/" component={Home}/>
<Route exact path="/Service" component={Service}/>
<Route exact path="/Contact" component={Contact}/>
<Redirect to='/' />

</Switch>
<Footer/>
</Router>
</div>

</body>
</>
  );
  }
export default App;
